import React, { useState, useEffect } from 'react';
import Card from '@material-ui/core/Card';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import EmailIcon from '@material-ui/icons/Email';
import PhoneIphoneIcon from '@material-ui/icons/PhoneIphone';


import NavBar from '../components/AppBar/index';
import ContactForm from '../components/ContactForm/index'
import Button from '@material-ui/core/Button';

function Copyright() {
    return (
        <Typography variant="body2" color="textSecondary" align="center">
            {'Copyright Â© '}
            <Link color="inherit" href="https://material-ui.com/">
                Zachary Nylen
      </Link>{' '}
            {new Date().getFullYear()}
            {'.'}
        </Typography>
    );
}

const useStyles = makeStyles(theme => ({
    icon: {
        marginRight: theme.spacing(2),
    },
    heroContent: {
        backgroundColor: theme.palette.background.paper,
        padding: theme.spacing(8, 0, 6),
    },
    heroButtons: {
        marginTop: theme.spacing(4),
    },
    cardGrid: {
        paddingTop: theme.spacing(8),
        paddingBottom: theme.spacing(8),
    },
    card: {
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
    },
    cardMedia: {
        paddingTop: '56.25%', // 16:9
    },
    cardContent: {
        flexGrow: 1,
    },
    footer: {
        backgroundColor: theme.palette.background.paper,
        padding: theme.spacing(6),
    },
}));

export default function Contact() {
    const classes = useStyles();

    return (
        <React.Fragment>
            <CssBaseline />
            <NavBar />
            <main style={{ backgroundColor: "#f7f7f7", height: "800px" }}>
            <div style={{ height: 'calc(110vh)', backgroundImage: `url(/images/background3.jpg)`, backgroundSize: 'cover' }}>
                {/* Hero unit */}
                <Container style={{ width: "80%", textAlign: "center" }}>
                <Card style={{ width: "90%", marginTop: "100px", display: "inline-block", border: "5px #bfbfbf solid", backgroundColor: "#e6e6e6" }}>
                    <div style={{ margin: "20px" }}>
                            <Typography style={{ }}><EmailIcon style={{ fontSize: "30px" }}/>&nbsp;&nbsp;znylen@gmail.com</Typography>
                        <Typography><PhoneIphoneIcon style={{ fontSize: "30px" }}/>&nbsp;&nbsp;503.804.7852</Typography>
                    <ContactForm/>
                    <Button style={{ backgroundColor: "#424242", color: "white", width: "50%", height: "50px", marginTop: "25px", marginBottom: "10px" }} variant="contained" >SUBMIT</Button>
                    </div>
                </Card>
                </Container>
                </div>
            </main>
            {/* Footer */}
            <footer className={classes.footer} style={{ backgroundColor: "#00695D" }}>
                <Typography style={{ color: "white" }} variant="subtitle1" align="center" component="p">
                    "It's not that we use technology, we live technology." - Godfrey Reggio
        </Typography>
                <br></br>
                <Copyright />
            </footer>
            {/* End footer */}
        </React.Fragment>
    );
}
